import React, {useState, useEffect,Component} from "react";
import { render } from "react-dom";
import axios from "axios";

/*
https://api.coingecko.com/api/v3/coins/markets?vs_currency=USD&order=market_cap_desc&per_page=100&page=3&sparkline=true
*/

function CoinCard (){

    const [coin, setCoin] = useState([]);
    useEffect( () =>{
        axios.get('https://api.coingecko.com/api/v3/coins/markets?vs_currency=USD&order=market_cap_desc&per_page=100&page=3&sparkline=true'). then(res =>{
            setCoin(res.data);
            
        }).catch(error=> console.log(error))
    }, []);

    return(

        <div className="CoinCard">
            
            <div>
                <img src={'./Icons/bitconIcon.png'} alt="crypto icon"/>
            </div>
            <div>
                <h2>token Name</h2>
                <h3>token Symbol</h3>
            </div>
            <div>
                <h2>Token Price</h2>
                <h3>Token detail</h3>
            </div>
            
        </div>
    )
}

export default CoinCard
